import React, { Component } from 'react'
import '../Styles/About.css'

 class About extends Component {
  render() {
    return (
      <div id='about'>
        <h1>About US</h1>
        <p>
Our foremost priority is tailoring our offerings precisely to your needs. We provide a variety of options to enhance your experience, ensuring your holidays or business trips are optimized to match your exact requirements. Our goal is to deliver the best, perfectly aligned with what you seek.</p>
      </div>
    )
  }
}

export default About
